import search from "./image/search.png";
import wind from "./image/wind.png";
import humidity from "./image/humidity.png";
import "./style.css";
import weather_img from "./image/sunny_clouds.png";
import { useState } from "react";
import { API } from "./API.js";
const Home = () => {
  const [data, setData] = useState({
    celcius: 10,
    name_city: "Moscow",
    humidity: 10,
    speed_wind: 4,
  });
  const searchPressed = () => {
    // console.log("Search pressed");
    console.log(search);
    fetch(
      `${API.base}weather?q=${search}&units=metric&lang=ru&appid=${API.key}`
    )
      .then((res) => res.json())
      .then((result) => {
        const res_api = result;
        console.log(result);
        console.log(res_api);
        setWeather(result);
      });
  };
  return (
    <div className="container">
      <div className="weather">
        <div className="search">
          <input type="text" placeholder="Введите название города"></input>
          <button className="but_search">
            <img className="container_search" src={search}></img>
          </button>
        </div>
        <div className="winfo">
          <div className="cont_weather_img">
            <img className="weather_img" src={weather_img}></img>
          </div>

          <h1>22°C</h1>
          <h2>Москва</h2>
          <div className="details">
            <div className="col">
              <div className="cont_wind">
                <img className="wind_img" src={wind}></img>
                <div>
                  <p>2 м/с</p>
                  <p>Скорость ветра</p>
                </div>
              </div>
            </div>
            <div className="col">
              <div className="cont_humid">
                <img className="humid_img" src={humidity}></img>
                <div>
                  <p>20%</p>
                  <p>Влажность</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
